import { Text, View, CheckBox, TextInput } from 'react-native';
import { MaterialCommunityIcons, AntDesign, Ionicons } from '@expo/vector-icons';

import { Wrapper, Header, Container, Logo, Nav, NavItem, NoConnection, Group, Title } from './styles';

import logo from '../../images/Netflix-logo2.png';

export default function Home(props) {

    return (
        <Wrapper>
            <Container>
                <Header>
                    <Title>Montar jogo</Title>
                    <Ionicons name="md-car" size={32} color="#999" />
                </Header>
                {groups.map(group => (
                    <Group check={groupsSelected.includes(group._id)} onPress={() => selectGroup(group._id)} key={group._id}><Text>{group.label}</Text></Group>
                ))}
                <TextInput></TextInput>
            </Container>
        </Wrapper>
    );
}
